import React from 'react';

const ProgressChart = () => (
  <div className="p-4 bg-white shadow rounded-xl">
    <h2 className="text-xl font-bold mb-2">Project Progress</h2>
    <div className="text-center text-gray-500">[Graph Coming Soon]</div>
  </div>
);

export default ProgressChart;
